import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { Login } from './Pages/Login/Login';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/loginsignup">
          <Login />
        </Route>

      </Routes>
    </Router>
  );
}

export default App;
